import React, { Component } from 'react';

class addTargetComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            targetCode :'',
            targetName :''
        }
        this.TargetCodeHandler=this.TargetCodeHandler.bind(this);
        this.TargetNameHandler=this.TargetNameHandler.bind(this);
    }
    TargetCodeHandler=(event)=>{
        this.setState({ targetCode:  event.target.value})
    }
    TargetNameHandler=(event)=>{
        this.setState({ targetName:  event.target.value})
    }

    render() {
        return (
            <div>
               <div className="container">
                    <div className="row">
                        <div className="card col-md-6 offset-md-3 offset-md-2 ">
                            <h3 className="text-center">Add Target</h3>
                            <div className="card-body">
                                <form>

                                    <div className="form-group">
                                        <label>Target Code</label>
                                        <input type="text" className="form-control" name="targetCode" value={this.state.targetCode}
                                         placeholder="Target Code" onChange={this.TargetCodeHandler}/>

                                        <label>Target Name</label>
                                        <input type="text" className="form-control" name="targetname" value={this.state.targetName}
                                         placeholder="Target Name" onChange={this.TargetNameHandler}/>
                            

                                    </div>

                                </form>
                            </div>
                        </div>
                    </div>
               </div>
            </div>
        );
    }
}

export default addTargetComponent;
